import React from 'react'
import { Link } from 'react-router-dom'
import articles from './articlecontent'

const ArticlesList = () => {
    return (
    <>
        {articles.map(article => (
            <Link key={article.slug} to={article.title}>{article.title}</Link>
        ))
    }
    </>
    )
}

export default ArticlesList
